using Dates

function event_scheduler(events)
    if isempty(events)
        return "No events"
    end

    for (i, event) in enumerate(events)
        start_time, finish_time = event
        for j in i+1:length(events)
            other_start_time, other_finish_time = events[j]
            if overlap(start_time, finish_time), other_start_time, other_finish_time)
                return "Conflict"
            end
        end
    end

    return "No conflicts"

function overlap(start1, end1), start2, end2)
    # Check if the intervals intersect
    return (start1 < end2) && (start2 < end1))
end
